// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title DecentralizedLottery
 * @author Your Name
 * @notice A decentralized lottery system where players buy tickets and a random winner is selected
 * @dev Implements time-based rounds, secure ETH handling with CEI pattern, and pseudo-random winner selection
 */
contract DecentralizedLottery {
    // ============ STATE VARIABLES ============

    /// @notice Contract owner who can start rounds
    address public owner;

    /// @notice Fixed price per lottery ticket
    uint public constant TICKET_PRICE = 0.01 ether;

    /// @notice Duration of each lottery round
    uint public constant ROUND_DURATION = 5 minutes;

    /// @notice Current round number (starts at 0, increments with each new round)
    uint public roundNumber;

    /// @notice Timestamp when the current round ends
    uint public roundEndTime;

    /// @notice Array of all players who bought tickets in current round
    /// @dev Players can appear multiple times if they bought multiple tickets
    address[] public players;

    /// @notice Address of the last round's winner
    address public lastWinner;

    /// @notice Prize amount won in the last round
    uint public lastPrizeAmount;

    /// @notice Nonce for randomness generation (increments with each use)
    uint private nonce;

    // ============ EVENTS ============

    /// @notice Emitted when a new round starts
    event RoundStarted(uint roundNumber, uint endTime);

    /// @notice Emitted when a player purchases tickets
    event TicketPurchased(address indexed player, uint ticketCount);

    /// @notice Emitted when a winner is selected
    event WinnerSelected(address indexed winner, uint prize, uint roundNumber);

    // ============ MODIFIERS ============

    /**
     * @notice Restricts function access to only the contract owner
     */
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    // ============ CONSTRUCTOR ============

    /**
     * @notice Initializes the lottery contract
     * @dev Sets the deployer as the owner and initializes round number to 0
     */
    constructor() {
        owner = msg.sender;
        roundNumber = 0;
    }

    // ============ MAIN FUNCTIONS ============

    /**
     * @notice Starts a new lottery round
     * @dev Only owner can call. Clears previous round data and sets new end time
     */
    function startNewRound() public onlyOwner {
        // Ensure previous round has ended or this is the first round
        require(
            roundEndTime == 0 || block.timestamp >= roundEndTime,
            "Current round has not ended yet"
        );

        // Clear the players array for the new round
        delete players;

        // Increment the round number
        roundNumber++;

        // Set the end time for this round
        roundEndTime = block.timestamp + ROUND_DURATION;

        emit RoundStarted(roundNumber, roundEndTime);
    }

    /**
     * @notice Allows a player to buy lottery tickets
     * @dev Players can buy multiple tickets by sending exact multiples of TICKET_PRICE
     *      Each ticket gives the player one entry in the draw
     */
    function buyTicket() public payable {
        // CHECKS
        require(isRoundActive(), "No active round");
        require(msg.value > 0, "Must send ETH to buy tickets");
        require(msg.value % TICKET_PRICE == 0, "Must send exact multiple of ticket price");

        // Calculate number of tickets being purchased
        uint ticketCount = msg.value / TICKET_PRICE;

        // EFFECTS
        // Add the player to the array once for each ticket purchased
        // This gives them proportional chances of winning
        for (uint i = 0; i < ticketCount; i++) {
            players.push(msg.sender);
        }

        emit TicketPurchased(msg.sender, ticketCount);

        // INTERACTIONS (none in this function - all ETH stays in contract)
    }

    /**
     * @notice Selects a random winner and distributes the prize
     * @dev Can be called by anyone after the round ends
     *      Uses pseudo-random number generation (suitable for low-stakes lottery)
     *      Follows Checks-Effects-Interactions pattern for security
     */
    function selectWinner() public {
        // CHECKS
        require(!isRoundActive(), "Round is still active");
        require(roundEndTime > 0, "No round has been started");
        require(players.length > 0, "No players in this round");

        // Generate a pseudo-random index
        uint randomIndex = _generateRandomNumber() % players.length;

        // Get the winner's address
        address winner = players[randomIndex];

        // Calculate the prize (entire contract balance)
        uint prize = address(this).balance;

        // EFFECTS - Update state BEFORE sending money
        lastWinner = winner;
        lastPrizeAmount = prize;

        // Clear players array for next round
        delete players;

        // Reset round end time
        roundEndTime = 0;

        // Emit event
        emit WinnerSelected(winner, prize, roundNumber);

        // INTERACTIONS - Send money AFTER all state updates
        (bool success, ) = payable(winner).call{value: prize}("");
        require(success, "Prize transfer failed");
    }

    // ============ VIEW FUNCTIONS ============

    /**
     * @notice Checks if there is an active round
     * @return bool True if a round is currently active
     */
    function isRoundActive() public view returns (bool) {
        return block.timestamp < roundEndTime && roundEndTime > 0;
    }

    /**
     * @notice Gets the time remaining in the current round
     * @return uint Seconds remaining, or 0 if no active round
     */
    function getTimeRemaining() public view returns (uint) {
        if (!isRoundActive()) {
            return 0;
        }
        return roundEndTime - block.timestamp;
    }

    /**
     * @notice Gets the total number of players (ticket entries) in current round
     * @return uint Number of entries
     */
    function getPlayerCount() public view returns (uint) {
        return players.length;
    }

    /**
     * @notice Gets the current prize pool
     * @return uint Total ETH in the contract
     */
    function getPrizePool() public view returns (uint) {
        return address(this).balance;
    }

    /**
     * @notice Gets all players in the current round
     * @return address[] Array of all player addresses (with duplicates for multiple tickets)
     */
    function getPlayers() public view returns (address[] memory) {
        return players;
    }

    /**
     * @notice Gets the number of tickets a specific address has in the current round
     * @param player Address to check
     * @return uint Number of tickets owned by the address
     */
    function getPlayerTicketCount(address player) public view returns (uint) {
        uint count = 0;
        for (uint i = 0; i < players.length; i++) {
            if (players[i] == player) {
                count++;
            }
        }
        return count;
    }

    /**
     * @notice Gets comprehensive lottery status
     * @return _isActive Whether round is active
     * @return _timeRemaining Seconds remaining in round
     * @return _playerCount Number of entries
     * @return _prizePool Current prize amount
     * @return _roundNumber Current round number
     */
    function getLotteryStatus() public view returns (
        bool _isActive,
        uint _timeRemaining,
        uint _playerCount,
        uint _prizePool,
        uint _roundNumber
    ) {
        return (
            isRoundActive(),
            getTimeRemaining(),
            getPlayerCount(),
            getPrizePool(),
            roundNumber
        );
    }

    // ============ INTERNAL FUNCTIONS ============

    /**
     * @notice Generates a pseudo-random number
     * @dev Uses block variables and contract state for randomness
     *      WARNING: Not suitable for high-stakes applications
     *      For production with large amounts, use Chainlink VRF
     * @return uint Pseudo-random number
     */
    function _generateRandomNumber() private returns (uint) {
        nonce++;
        return uint(keccak256(abi.encodePacked(
            block.timestamp,
            block.prevrandao,  // More secure than block.difficulty (post-merge)
            players.length,
            nonce,
            msg.sender
        )));
    }

    // ============ FALLBACK FUNCTIONS ============

    /**
     * @notice Fallback function to reject direct ETH transfers
     * @dev Players must use buyTicket() function
     */
    receive() external payable {
        revert("Use buyTicket() to enter the lottery");
    }

    fallback() external payable {
        revert("Use buyTicket() to enter the lottery");
    }
}

